            backgroundColor: "rgb(255, 99, 132)",
            borderColor: "rgb(255, 99, 132)",
          },
          {
            data: dailyData(({ deaths }) => deaths),
            labels: deaths,
            backgroundColor: "red",
            borderColor: "blue",
            backgroundColor: "rgb(255, 0, 0,0.5)",
